import React from 'react';

const Services = () => {
  return (
    <div className="container mt-5">
      <h1>Our Services</h1>
      <ul>
        <li>Car Rentals</li>
        {/* <li>Customer Support</li> */}
        {/* <li>Agency Partnerships</li> */}
      </ul>
    </div>
  );
};

export default Services;
